import React from "react";
import { NavLink } from "react-router-dom";

function NavBar(){
    return(
    <nav>
      <div>
        <NavLink
        exact
        style={{color:"black",  textDecoration: "none"}}
        activeStyle={{color:"#eb5149"}}
        to="/main">
          머니 충전
        </NavLink>
      </div>
      <div>
        <NavLink to="/main/payCash">
          머니 결제
        </NavLink>
      </div>
      <div>
        <NavLink to="/payHistory">
          거래내역
        </NavLink>
      </div>
    </nav>
    )
}

export default NavBar;
